// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Diagnostic {

    struct Patient  {
        string name;
        string bloodtype;
        uint weight;
        uint height;
        uint age;
        string Birth_date; 
        string Gender; 
        address patient_add;
    }
    struct PatientContact {
        string email;
        string phone;
        string Name_Emergency;
        string Phone_Emergency;
        string Relationship;
    }
    struct Analyse {
        uint id; //auto incriment
        string name;
        address patient;
        address doctor;
        string resultat;
        uint price;
        bool paid;
    }

    struct Record { // auto incriment
        uint id;
        //address p;
        uint[] test_id;
        Prescription prescription;
        string status;
        uint diagnostic_time;
        address doctor;
    }

    struct Prescription {
        address p;
        uint id_rec;
        address doctor;
        address pharmacie;
        uint[] medecines_id;
        uint price;
        bool isPaid;
        bool isDelivered;
        address deliveryAddress;
    }

    struct Medecine {
        uint id; //auto incriment 
        string name; 
        string dosage;
        uint duration;
        string instructions;
    }
    
    mapping(address => Patient) public patient_information;
    mapping(address => PatientContact) public patient_contact;
    mapping(address => Prescription[]) public pharmacie_prescriptions;
